function App() {
  return (
    <div className="app">
      <p> I AM A PARAGRAPH</p>
      <a href="https://www.google.com/search?q=google&oq=GOO&aqs=chrome.0.69i59l3j0l2j69i60l3.2278j0j7&sourceid=chrome&ie=UTF-8">
        Visit GooGle
      </a>
    </div>
  );
}

export default App;
